//import './App.css';
import React from 'react';
import Section from './components/Section'
import {BrowserRouter,Route,Switch} from 'react-router-dom' 
function App() {
  return (
    <div className="App">
      <BrowserRouter>
         <switch>

          <Route path="/section" component = {Section}></Route>


         </switch>
      </BrowserRouter>

         </div>
  );
}

export default App;
